import React, { Component } from "react";
import { Data } from "./input.js";
class Contact extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        {this.props.name}
        <br />
        {this.props.number}
      </div>
    );
  }
}

class List extends Component {
  render() {
    let list = Data.map(i => (
      <li>
        <Contact name={i.name} number={i.number} />
      </li>
    ));
    return <div>{list}</div>;
  }
}

export default List;
